import { Row } from "antd";
import { withTranslation } from "react-i18next";
import RoadmapContentBlock from "../ContentBlock/RoadmapContentBlock";

import {
  GenContainer,
  BlockContainer,
  ContentWrapperTitle,
  ContentTitle,
} from "./styles";

const Roadmap = () => {

  return (
    <GenContainer>
      <BlockContainer>
          <Row justify="center" align="middle">
            <ContentWrapperTitle>
                <h1>Roadmap</h1>
                <ContentTitle>Landy comes with multi-lingual support, all of .</ContentTitle>
            </ContentWrapperTitle>
          </Row>

        <RoadmapContentBlock 
          title="Launch on October 30th - 10PM UTC"
          content="5,555 wibas will be available during our main launch. A few days after the launch will take place the WibCard airdrop"
          icon=""
          direction="left"
        />

        <RoadmapContentBlock 
          title="WibCard airdrop"
          content="1,111 WibCard will be sent randomly to the owners of WibAs. These cards will allow you to participate in a game. Access to the game will only be made with this card."
          icon=""
          direction="left"
        />

        <RoadmapContentBlock
          title="The Game"
          content="The game will be decided by the wiba community. X number of winners will win a SOL award. Each time the royalties are high, a new game will be organized."
          icon=""
          direction="left"
        />
      </BlockContainer>
    </GenContainer>
  );
};

export default withTranslation()(Roadmap);
